        `,program:["Sekmt dalbnieku emocionlo un intelektulo veidoanos par brvu, atbildgu un radou personbu.","Veidot audzku interesi par dejas mkslu.","Veidot izpratni par Latvijas kultras vrtbu un tradciju saglabanu.","Sagatavoties Dziesmu un deju svtkiem, Daugavpils pilstas koncertiem un skolas veidotajiem paskumiem."],images:[bk,Sk,zk,Ek,Tk,Ck,Nk,Pk]},robotika:{title:"Robotika",teacher:"Skolotjs Krlis Rasis",grade:"7.-12.klase",link:"/interests/robotika",description:`
